        var start = pt(this.i_radius*Math.cos((i*this.theta+90)*Math.PI/180),this.i_radius*Math.sin((i*this.theta+90)*Math.PI/180)),
            end = pt(this.o_radius*Math.cos((i*this.theta+90)*Math.PI/180),this.o_radius*Math.sin((i*this.theta+90)*Math.PI/180));
