function onEdge() {
    var vsbBnds = $world.getBounds(),
        x = this.getPosition().x,
        y = this.getPosition().y;
        if(x<=vsbBnds.x)
            return 'left'
        else if(x>=vsbBnds.width)
            return 'right'
        else if(y<=vsbBnds.y)
            return 'top'
        else if(y>=vsbBnds.height)
            return 'bottom'
        else
            return false
}
